import React from "react";
import ActiveWeatherIcon from "./ActiveWeatherIcon";
import WeatherIcon from "./WeatherIcon";

const IconsContainer = props => (
  <>
    {props.description === "clear sky" ? (
      <ActiveWeatherIcon icon={<i className="fas fa-sun fa-5x active " />} />
    ) : (
      <WeatherIcon icon={<i className="fal fa-sun fa-5x" />} />
    )}

    {props.description === "few clouds" ||
    props.description === "scattered clouds" ||
    props.description === "broken clouds" ? (
      <ActiveWeatherIcon
        icon={
          <i className="fas fa-cloud-sun fa-5x fa-flip-horizontal active " />
        }
      />
    ) : (
      <WeatherIcon
        icon={<i className="fal fa-cloud-sun fa-5x fa-flip-horizontal" />}
      />
    )}

    {props.description === "overcast clouds" ? (
      <ActiveWeatherIcon icon={<i className="fas fa-cloud fa-5x active " />} />
    ) : (
      <WeatherIcon icon={<i className="fal fa-cloud fa-5x" />} />
    )}
  </>
);

export default IconsContainer;
